import React from "react";

export default function Item({ text, moveToNext, index, key, v, id }) {
  console.log(id);
  return (
    <div key={key} className={index === v.length - 1 ? "hidden" : "block"}>
      <button>Prev</button>
      <span>{text}</span>
      <button onClick={() => moveToNext(index, id)}>Next</button>
    </div>
  );
}
